import React from 'react';
import  '../../index.css';
import {connect} from 'react-redux';
import { getLiveStatsAction } from "../../store/actions/statActions";


const TestedSamples = (props) => {
    console.log(props)
    return (
        <div>
            <p className="tested text-muted">{props.tested} Samples are being tested till now.</p>
        </div>
    )
}

const mapStateToProps = (state) => {
    return{
        tested: state.stats.testedSamplesData
    }
}

const mapDispatchToProps = (dispatch) => {
    return {
      getLiveStats: () => dispatch(getLiveStatsAction()),
    };
  };
  

export default connect(mapStateToProps, mapDispatchToProps)(TestedSamples)
